INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES ('963b6b0a-04a8-11e3-94de-005056be3574', 'Штукатурка роллерная декоративная с эффектом "короеда" Белый 15кг', '6aa6af7c-ff83-11e4-9228-005056be1f7a', '0', '38', '18', 'Штукатурка фактурная ЛАКРА с эффект "короеда", готовая к применению декоративная штукатурка повышенной белизны на основе водной акриловой дисперсии. Легко наносится валиком. Создает прочное влагостойкое, паропроницаемое покрытие, стойкое к атмосферным воздействиям и эксплуатационным нагрузкам. Обладает отличной адгезией к поверхностям из бетона, камня, гипса, цемента, кирпича, ДСП, ДВП. Не содержит растворителей, без запаха. Допускает мытье окрашенной поверхности. Колеруется в светлые оттенки.', '1'), ('f5f1fcd6-d1c2-11e3-8b7a-005056be1f7b', 'Штукатурка структурная декоративная с эффектом "зернистости" размер "зерна" 1,5мм Белый 15кг', '6aa6af7c-ff83-11e4-9228-005056be1f7a', '0', '47', '0', 'Для декоративной отделки поверхностей внутри и снаружи помещений. Готовая к применению декоративная штукатурка повышенной белизны на основе водной акриловой дисперсии с равномерно зернистой структурой. Скрывает небольшие неровности основания. Легко наносится. Образуемый рельеф получается плавным и приятным на ощупь. Создает прочное влагостойкое, паропроницаемое покрытие, стойкое к атмосферным воздействиям и эксплуатационным нагрузкам. Обладает отличной адгезией к поверхностям из бетона, камня, гипса, цемента, кирпича, ДСП, ДВП. Не содержит растворителей, без запаха. Размер зерна ~ 1,5 мм. Допускает мытье окрашенной поверхности.', '1'), ('0916172c-947c-11e3-8d88-005056be1f7b', 'Штукатурка структурная декоративная с эффектом "зернистости" размер "зерна" 2мм Белый 15кг', '6aa6af7c-ff83-11e4-9228-005056be1f7a', '0', '32', '18', 'Для декоративной отделки поверхностей внутри и снаружи помещений. Готовая к применению декоративная штукатурка повышенной белизны на основе водной акриловой дисперсии с равномерно зернистой структурой. Скрывает небольшие неровности основания. Легко наносится. Образуемый рельеф получается плавным и приятным на ощупь. Создает прочное влагостойкое, паропроницаемое покрытие, стойкое к атмосферным воздействиям и эксплуатационным нагрузкам. Обладает отличной адгезией к поверхностям из бетона, камня, гипса, цемента, кирпича, ДСП, ДВП. Не содержит растворителей, без запаха. Размер зерна ~ 1,5 мм. Допускает мытье окрашенной поверхности.', '1'), ('fded4984-d1c2-11e3-8b7a-005056be1f7b', 'Штукатурка структурная декоративная с эффектом "зернистости" размер "зерна" 13мм Белый 15кг', '6aa6af7c-ff83-11e4-9228-005056be1f7a', '0', '13', '0', 'Для декоративной отделки поверхностей внутри и снаружи помещений. Готовая к применению декоративная штукатурка повышенной белизны на основе водной акриловой дисперсии с равномерно зернистой структурой. Скрывает небольшие неровности основания. Легко наносится. Образуемый рельеф получается плавным и приятным на ощупь. Создает прочное влагостойкое, паропроницаемое покрытие, стойкое к атмосферным воздействиям и эксплуатационным нагрузкам. Обладает отличной адгезией к поверхностям из бетона, камня, гипса, цемента, кирпича, ДСП, ДВП. Не содержит растворителей, без запаха. Размер зерна ~ 1,5 мм. Допускает мытье окрашенной поверхности.', '1'), ('d5823752-947b-11e3-8d88-005056be1f7b', 'Штукатурка фактурная декоративная с эффектом "шубы" Белый 15кг', '6aa6af7c-ff83-11e4-9228-005056be1f7a', '0', '7', '18', 'Готовая к применению декоративная штукатурка повышенной белизны на основе водной акриловой дисперсии. Образует на поверхности рельеф в виде «шубы». Скрывает небольшие неровности основания. Легко наносится валиком. Создает прочное влагостойкое, паропроницаемое покрытие, стойкое к атмосферным воздействиям и эксплуатационным нагрузкам. Обладает отличной адгезией к поверхностям из бетона, камня, гипса, цемента, кирпича, ДСП, ДВП. Не содержит растворителей, без запаха. Допускает мытье окрашенной поверхности.', '1'), ('0d8fcbcd-99a8-11db-937f-000e0c431b59', 'Грунт акриловый "PARADE" G30  4л', '569e2345-ff83-11e4-9228-005056be1f7a', '0', '164', '29', 'Грунтовка акриловая глубокого проникновения. Высококачественная готовая к употреблению грунтовка с высокой проникающей способностью и отличными связующими свойствами.', '1'), ('0d8fcbcf-99a8-11db-937f-000e0c431b59', 'Грунт акриловый "PARADE" G30 10л', '569e2345-ff83-11e4-9228-005056be1f7a', '0', '99', '25', 'Грунтовка акриловая глубокого проникновения. Высококачественная готовая к употреблению грунтовка с высокой проникающей способностью и отличными связующими свойствами.', '1'), ('0d8fcbd1-99a8-11db-937f-000e0c431b59', 'Грунт под штукатурки "PARADE" Putzgrund G100 Белый 2,5л', '569e2345-ff83-11e4-9228-005056be1f7a', '0', '405', '46', 'Parade G100 Putzgrund — грунтовка для внутренних работ. Это основа любых отделочных работ. Грунтовки Парад для паркета предотвращают появления масел и воска, заполняют неровности и идеально подготавливают поверхность для нанесения лака. Они производятся на минеральной, акриловой, алкидной и других основах. Также улучшают структурные свойства гладких оснований. В зависимости от вида грунтовки перед применением разбавляются растворителем либо водой.', '1'), ('076d213b-4380-11de-8f53-000e0c431b58', 'Грунт-эмаль по ржавчине белая 0,75л  DALI', '569e2345-ff83-11e4-9228-005056be1f7a', '0', '187', '55', 'Применяется для наружных и внутренних работ для окрашивания цветных металлов, оцинкованного металла и нержавеющей стали. Металлическую поверхность, обработанную грунт-эмалью, эффективно защищает от образования коррозии и создает атмосферостойкое, водостойкое покрытие.', '1'), ('da49edc1-58f9-11e0-894e-000e0c431b58', 'Грунт-эмаль по ржавчине белая 10л  DALI', '569e2345-ff83-11e4-9228-005056be1f7a', '0', '0', '0', 'Применяется для наружных и внутренних работ для окрашивания цветных металлов, оцинкованного металла и нержавеющей стали. Металлическую поверхность, обработанную грунт-эмалью, эффективно защищает от образования корр