ны и потолки помещений, подвергающиеся максимальным эксплуатационным нагрузкам (любые офисные и жилые помещения), подходит для окраски обоев.', '1'), ('bf4804e2-fc0e-11dd-bd91-000e0c431b58', 'Краска акрил. "PARADE" W4 База С Бесцветный 2,5 л', '7ab9d88b-fe13-11e4-9228-005056be1f7a', '0', '168', '34', 'Parade W4 — краска акриловая для внутренних работ. Допускается частая влажная уборка с применением моющих средств, выдерживает более 3000 циклов мытья. Parade W4 применяется на стены и потолки помещений, подвергающиеся максимальным эксплуатационным нагрузкам (любые офисные и жилые помещения), подходит для окраски обоев.', '1'), ('f63c664a-52ee-11dd-a89a-000e0c431b58', 'Краска акрил. "PARADE" W4 База С Бесцветный 9л', '7ab9d88b-fe13-11e4-9228-005056be1f7a', '0', '124', '32', 'Parade W4 — краска акриловая для внутренних работ. Допускается частая влажная уборка с применением моющих средств, выдерживает более 3000 циклов мытья. Parade W4 применяется на стены и потолки помещений, подвергающиеся максимальным эксплуатационным нагрузкам (любые офисные и жилые помещения), подходит для окраски обоев.', '1'), ('a6f80c96-516a-11dd-a89a-000e0c431b58', 'Краска ВД акриловая д/обоев DALI 2,5л (Рогнеда)', '7ab9d88b-fe13-11e4-9228-005056be1f7a', '0', '113', '49', 'Краска DALI акриловая для обоев обладает отличной адгезией к бумажным, флизелиновым и стеклообоям. Благодаря специально разработанному составу, краска DALI обладает хорошей укрывистостью и без проблем наносится на обои под покраску, сохраняя фактуру. Так же краска DALI может быть нанесена на минеральные поверхности, такие как гипсокартон, штукатурки, шпатлевки и тому подобные покрытия. Единственным условием к поверхности - нормальная влажность и температура в помещении, в котором производятся работы. Краска Dali содержит в составе специальные антибактериальные добавки, препятствующие образованию и размножению био организмов и бактерий. Кроме того краска DALI устойчива к влажной уборке и применению моющих средств, что делает стены и потолок помещения долговечными. Существуют две разновидности краски DALI - база А, подходящая и для машинной и для ручной колеровки, и база С, подходящая только для машинной колеровки. Купить и заколеровать краску DALI, а так же другую продукцию компании Рогнеда Вы можете в интернет магазине СтройБери, а так же в сети розничных магазинов.', '1'), ('a6f80c98-516a-11dd-a89a-000e0c431b58', 'Краска ВД акриловая д/обоев DALI 5л (Рогнеда)', '7ab9d88b-fe13-11e4-9228-005056be1f7a', '0', '58', '46', 'Краска DALI акриловая для обоев обладает отличной адгезией к бумажным, флизелиновым и стеклообоям. Благодаря специально разработанному составу, краска DALI обладает хорошей укрывистостью и без проблем наносится на обои под покраску, сохраняя фактуру. Так же краска DALI может быть нанесена на минеральные поверхности, такие как гипсокартон, штукатурки, шпатлевки и тому подобные покрытия. Единственным условием к поверхности - нормальная влажность и температура в помещении, в котором производятся работы. Краска Dali содержит в составе специальные антибактериальные добавки, препятствующие образованию и размножению био организмов и бактерий. Кроме того краска DALI устойчива к влажной уборке и применению моющих средств, что делает стены и потолок помещения долговечными. Существуют две разновидности краски DALI - база А, подходящая и для машинной и для ручной колеровки, и база С, подходящая только для машинной колеровки. Купить и заколеровать краску DALI, а так же другую продукцию компании Рогнеда Вы можете в интернет магазине СтройБери, а так же в сети розничных магазинов.', '1'), ('56a6f723-ea03-11de-860d-000e0c431b58', 'Краска ВД акриловая д/обоев DALI 9л (Рогнеда)', '7ab9d88b-fe13-11e4-9228-005056be1f7a', '0', '55', '37', 'Краска DALI акриловая для обоев обладает отличной адгезией к бумажным, флизелиновым и стеклообоям. Благодаря специально разработанному составу, краска DALI обладает хорошей укрывистостью и без проблем наносится на обои под покраску, сохраняя фактуру. Так же 