я внутри помещений по минеральным поверхностям (бетон, кирпич, гипс, цемент, гипсокартон, шпатлевка, штукатурка и др.).', '1'), ('ece048ee-fbaf-11e0-b702-001cc494be80', 'Краска ВД-АК "Водоэмульсионка.рф" интерьер. супербел. 13кг', '7ab9d88b-fe13-11e4-9228-005056be1f7a', '0', '0', '63', 'Краска акриловая потолочная предназначена для выполнения высококачественной окраски потолков внутри помещений с нормальной влажностью: Гостиные комнаты, спальни, детские комнаты, а также общественные и производственные помещения. Краска обладает идеальной белизной. Легко наносится на поверхность потолка без подтеков, брызг и разводов. Быстро сохнет. После нанесения образует ровную матовую поверхность. Скрывает микронеровности потолка. «Дышащее покрытие». Не желтеет. Не мелит. Без запаха. Гипоаллергенная. Устойчива к сухой уборке. Морозостойкая.', '1'), ('ece048eb-fbaf-11e0-b702-001cc494be80', 'Краска ВД-АК "Водоэмульсионка.рф" интерьер. супербел. 6кг', '7ab9d88b-fe13-11e4-9228-005056be1f7a', '0', '0', '55', 'Краска акриловая потолочная предназначена для выполнения высококачественной окраски потолков внутри помещений с нормальной влажностью: Гостиные комнаты, спальни, детские комнаты, а также общественные и производственные помещения. Краска обладает идеальной белизной. Легко наносится на поверхность потолка без подтеков, брызг и разводов. Быстро сохнет. После нанесения образует ровную матовую поверхность. Скрывает микронеровности потолка. «Дышащее покрытие». Не желтеет. Не мелит. Без запаха. Гипоаллергенная. Устойчива к сухой уборке. Морозостойкая.', '1'), ('ece048f2-fbaf-11e0-b702-001cc494be80', 'Краска ВД-АК "Водоэмульсионка.рф" фасад. супербел. 13кг', '7ab9d88b-fe13-11e4-9228-005056be1f7a', '0', '0', '72', 'Краска акриловая фасадная предназначена для высококачественной окраски фасадов зданий и сооружений, а также для окраски стен и потолков внутри помещений. Краска обладает повышенной износостойкостью, влагостойкостью и атмосферостойкостью. Краску можно наносить на бетонные, кирпичные, заштукатуренные, зашпатлеванные и прочие минеральные поверхности, а также на гипсокартон, дерево, двп, дсп и обои под покраску.
