INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES ('1a0a8b53-99a8-11db-937f-000e0c431b59', 'Шпаклевка по дереву Береза 0,6кг ("Лакра")', '7eed2035-ff83-11e4-9228-005056be1f7a', '0', '59', '50', 'Шпатлевка по дереву ЛАКРА дереву на основе акриловой дисперсии с повышенной водостойкостью. Благодаря мелкозернистой структуре легко наносится и прекрасно шлифуется. Обладает отличной заполняющей способностью.
INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES ('e68fd7dc-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" для металла Серый 300мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', '0', '778', '162', 'Отличная адгезия к алюминию, железу, стали и другим металлическим поверхностям. Не вызывает коррозии у металлов (железо, сталь, алюминий, цинк). Шов не темнеет со временем, устойчив к деформации и нагрузкам. Водонепроницаем. Устойчив к атмосферным воздействиям и UV лучам.', '1'), ('e68fd7df-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" по дереву Parquet БУК 300мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', '0', '162', '170', 'Заделка и уплотнение соединений, щелей, зазоров в паркете, плинтусах, деревянном полу, стенах и других конструкциях. Уплотнение оконных и дверных рам с внутренней стороны.', '1'), ('77c5eb9b-4b14-11e1-bd83-001cc494be80', 'Герметик "KRASS" по дереву Parquet ВЕНГЕ 300мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', '0', '134', '152', 'Заделка и уплотнение соединений, щелей, зазоров в паркете, плинтусах, деревянном полу, стенах и других конструкциях. Уплотнение оконных и дверных рам с внутренней стороны.', '1'), ('e68fd7e2-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" по дереву Parquet ДУБ 300мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', '0', '215', '170', 'Заделка и уплотнение соединений, щелей, зазоров в паркете, плинтусах, деревянном полу, стенах и других конструкциях. Уплотнение оконных и дверных рам с внутренней стороны.', '1'), ('e68fd7e4-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" по дереву Parquet ДУБ темный 300мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', '0', '240', '158', 'Заделка и уплотнение соединений, щелей, зазоров в паркете, плинтусах, деревянном полу, стенах и других конструкциях. Уплотнение оконных и дверных рам с внутренней стороны.', '1'), ('e68fd7e6-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" по дереву Parquet СОСНА 300мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', '0', '138', '170', 'Заделка и уплотнение соединений, щелей, зазоров в паркете, плинтусах, деревянном полу, стенах и других конструкциях. Уплотнение оконных и дверных рам с внутренней стороны.', '1'), ('e68fd7e9-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" сил. Aqua-Silicon Бесцветный  300 мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', '0', '311', '176', 'Предназначен для герметизации и уплотнения аквариумов, склеивания витрин, стеклянных шкафов. Высокая эластичность шва. Является однокомпонентным, быстротвердеющим высокомодульным герметиком, который в реакции с атмосферной влагой образует эластичный, безусадочный, выдерживающий большие нагрузки, шов.', '1'), ('e68fd7ec-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" сил. Aqua-Silicon Черный  300 мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', '0', '213', '170', 'Предназначен для герметизации и уплотнения аквариумов, склеивания витрин, стеклянных шкафов. Высокая эластичность шва. Является однокомпонентным, быстротвердеющим высокомодульным герметиком, который в реакции с атмосферной влагой образует эластичный, безусадочный, выдерживающий большие нагрузки, шов.', '1'), ('e68fd7ee-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" сил. нейтрал. Белый   300 мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', '0', '50', '221', 'Незаменим для склеивания строительных материалов с гладкой и пористой поверхностью, металлов, бетона. Дает минимальную усадку. Превосходно склеивает поверхности в помещениях с высокой влажностью. Не обесцвечивает окрашенные поверхности. Рекомендуется строителями профессионалами.', '1'), ('e68fd7f1-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" сил. нейтрал. Бесцветный   300 мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', '0', '12', '209', 'Незаменим для склеивания строительных материалов с гладкой и пористой поверхностью, металлов, бетона. Дает минимальную усадку. Герметик силиконовый KRASS превосходно склеивает поверхности в помещениях с высокой влажностью. Не обесцвечивает окрашенные поверхности. Рекомендуется строителями профессионалами.', '1'), ('e68fd7f3-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" сил. САНИТАРНЫЙ Белый   300 мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', '0', '150', '344', 'Изготовлен на основе силикона и обладает сильным противогрибковым действием, препятствует появлению плесени, гнили и разного рода микроорганизмов. Он используется в условиях повышенной влажности (ванные комнаты, бани и т.д.), в канализационных и водоподающих сетях. Подходит для остеклительных работ и обработки подвижных/неподвижных швов снаружи и внутри зданий.', '1'), ('e68fd7f5-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" сил. САНИТАРНЫЙ Бесцветный  300 мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', '0', '131', '344', 'Изготовлен на основе силикона и обладает сильным противогрибковым действием, препятствует появлению плесени, гнили и разного рода микроорганизмов. Он используется в условиях повышенной влажности (ванные комнаты, бани и т.д.), в канализационных и водоподающих сетях. Подходит для остеклительных работ и обработки подвижных/неподвижных швов снаружи и внутри зданий.', '1'), ('e68fd7fa-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" сил. Универс. Белый   300 мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', '0', '552', '372', 'Обеспечивает отличное сцепление поверхностей из стекла, эмали, пластика, металла, керамике, дерева. Содержит противогрибковый компонент, препятствующий гниению, образованию плесени, грибков. Применяется в помещениях с повышенной влажностью.', '1'), ('e68fd7fc-99a6-11db-937f-000e0c431b59', 'Герметик "KRASS" сил. Универс. Бесцветный  300 мл', '18c0600b-03aa-11e5-bad4-005056be1f7a', '0', '1590', '384', 'Обеспечивает отличное сцепление поверхностей из стекла, эмали, пластика, металла, керамике, дерева. Содержит противогрибковый компонент, препятствующий гниению, образованию плесени, грибков. Применяется в помещениях с повышенной влажностью.', '1'), ('58970c19-5a2d-11de-a649-000e0c431b58', 'Герметик "KRASS" сил. Универс. Коричневый   300 мл', '18c0600b-03aa