INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES ('2eadcbef-99a8-11db-937f-000e0c431b59', 'Керосин 1л', '72429777-ff83-11e4-9228-005056be1f7a', '0', '218', '124', 'Для растворения и разбавления масляных ЛКМ, для горения в осветительных и нагревательных бытовых приборах,для промывки двигателей.', '1'), ('2eadcbf1-99a8-11db-937f-000e0c431b59', 'Керосин 5л', '72429777-ff83-11e4-9228-005056be1f7a', '0', '110', '45', 'Для растворения и разбавления масляных ЛКМ, для горения в осветительных и нагревательных бытовых приборах,для промывки двигателей.', '1'), ('a48048ba-ec8c-11e3-9eab-005056be1f7b', 'Ксилол 0,5л', '72429777-ff83-11e4-9228-005056be1f7a', '0', '86', '29', 'Используется для разбавления до рабочей вязкости при нанесении краскораспылителем различных автоэмалей, а также некоторых лаков,красок,эмалей и грунтовок на алкидной (ПФ, ГФ) ,эпоксидной (ЭП) и битумной (БТ) основах.', '1'), ('d1aa2ade-a3ef-11e1-ad4e-005056be3bd8', 'Очиститель Cosmofen-10 1л', '72429777-ff83-11e4-9228-005056be1f7a', '0', '27', '28', 'Очиститель нерастворяющий с антистатиком применяется для профессиональной чистки профелей из жесткого ПВХ, плат из вспененного твердого ПВХ, полиуретана и профелей кешированных ренолитной пленкой. Особенно хорош для очистки поверхности от пыли, остатков защитной пленки, жирных карандашей, следов резины, свежей полиуретановой пены и свежих остатков герметиков, таких как смола/битум. Оказывает хорошее действие на многие синтетические поверхности и в сочетании с антистатиком особенно хорош для выставочных и рекламных конструкций.', '1'), ('7e531df3-b5f5-11e1-83ba-005056be3bd8', 'Очиститель Cosmofen-20 1л прозр.', '72429777-ff83-11e4-9228-005056be1f7a', '0', '40', '30', 'Жидкое чистящее средство, не растворяющее поверхности. Применяется в качестве не размягчающего средства с антистатиком для очистки профилей из твердого ПХВ, профилей, кашированных пленкой из ренолита и профилей из полиуретана. Особенно пригоден для очистки от пыли, остатков клея с защитной пленки, жира, следов резины, свежей полиуретановой пены и свежих остатков размягченного ПВХ, а также следов шприцмашин для дегтя или битума. Применяемый антистатик эффективно предотвращает необходимость скорой повторной очистки от загрязнений поверхностей профиля и плит ПВХ.', '1'), ('2eadcbfc-99a8-11db-937f-000e0c431b59', 'Растворитель 646 0,5л', '72429777-ff83-11e4-9228-005056be1f7a', '0', '476', '256', 'Растворитель предназначен для разбавления лакокрасочных материалов и шпатлевок на основе: нитратоцелюлозных, нитратоцелюлозно-глифталевых, эпоксидных, нитратцелюлозно-эпоксидных, мочевино (меламино) формальдегидных, кремнеорганических (НЦ, ЭП, КО, МЧ, МС) и других лакокрасочных материалов.', '1'), ('2eadcbfe-99a8-11db-937f-000e0c431b59', 'Растворитель 646 1л', '72429777-ff83-11e4-9228-005056be1f7a', '0', '461', '235', 'Растворитель предназначен для разбавления лакокрасочных материалов и шпатлевок на основе: нитратоцелюлозных, нитратоцелюлозно-глифталевых, эпоксидных, нитратцелюлозно-эпоксидных, мочевино (меламино) формальдегидных, кремнеорганических (НЦ, ЭП, КО, МЧ, МС) и других лакокрасочных материалов.', '1'), ('2eadcc00-99a8-11db-937f-000e0c431b59', 'Растворитель 646 5л', '72429777-ff83-11e4-9228-005056be1f7a', '0', '189', '109', 'Растворитель предназначен для разбавления лакокрасочных материалов и шпатлевок на основе: нитратоцелюлозных, нитратоцелюлозно-глифталевых, эпоксидных, нитратцелюлозно-эпоксидных, мочевино (меламино) формальдегидных, кремнеорганических (НЦ, ЭП, КО, МЧ, МС) и других лакокрасочных материалов.', '1'), ('2eadcc10-99a8-11db-937f-000e0c431b59', 'Растворитель 650 0,5л', '72429777-ff83-11e4-9228-005056be1f7a', '0', '272', '198', 'Растворение и разбавление нитроцеллюлозных,алкидных эмалей. Представляет собой смеси летучих органических растворителей. Растворитель 650 предназначен для лакокрасочной и других отраслей промышленности для разбавления эмалей для легковых автомобилей.', '1'), ('2ced73cf-59ef-11e0-894e-000e0c431b58', 'Растворитель Cosmofen-5 1л', '72429777-ff83-11e4-9228-005056be1f7a', '0', '0', '0', 'Cпециальный очиститель па основе растворителя с размягчением поверхности для очистки от сильных загрязнений с проникновением в поверхностные слои частиц масла, изношенной резины, остатков клея, свежих остатков размягченного ПВХ и других загрязнений. Применяют для очистки материалов плит из ПВХ, других твердых и вспененных пластиковых плит и профилей из ПВХ.', '1'), ('897bb5a6-b0fa-11e3-b34d-005056be1f7b', 'Растворитель для эмалей и красок', '72429777-ff83-11e4-9228-005056be1f7a', '0', '2', '25', 'Рекомендуется для разбавления финишных покрытий Parade Z1, Parade F50, Parade F51.Также применяется для разбавления эмалей и красок на основе эпоксидных, виниловых, акриловых, кремнийорганических полимеров, нитроцеллюлозы, хлоркаучука, меламино- и мочевиноформальдегидных материалов, для очистки инструмента после их нанесения и обезжиривания поверхности. Тип растворителя: специальный растворитель.', '1'), ('ba1232df-ec8c-11e3-9eab-005056be1f7b', 'Растворитель Р-4 0,5л', '72429777-ff83-11e4-9228-005056be1f7a', '0', '377', '29', 'Представляет собой смеси летучих органических жидкостей. Растворитель Р-4 предназначен для разбавления лакокрасочных материалов на основе поливинилхлоридных хлорированных смол ПСХ ЛС и ПСХ ЛН, сополимеров винилхлорида, эпоксидных смол и других пленкообразующих веществ.', '1'), ('b08b1d7e-ec8c-11e3-9eab-005056be1f7b', 'Сольвент 0,5л', '72429777-ff83-11e4-9228-005056be1f7a', '0', '216', '58', 'Предназначен для растворения масляных, алкидных, алкидно-фенольных лаков, красок, эмалей, а также для разбавления масел, битумов, каучуков, меламиноалкидных ЛКМ.', '1'), ('e213c98a-ccbb-11e4-a1f9-005056be1f7b', 'Сольвент АЛТ 602/218 400 гр.', '72429777-ff83-11e4-9228-005056be1f7a', '0', '17', '48', 'Растворитель предназначен для разбавления лакокрасочных материалов и шпатлевок на основе: нитратоцелюлозных, нитратоцелюлозно-глифталевых, эпоксидных, нитратцелюлозно-эпоксидных, мочевино (меламино) формальдегидных, кремнеорганических (НЦ, ЭП, КО, МЧ, МС) и других лакокрасочных материалов.', '1'), ('2eadcc2e-99a8-11db-937f-000e0c431b59', 'Уайт-спирит 0,5л', '72429777-ff83-11e4-9228-005056be1f7a', '0', '950', '364', 'Растворение и разбавление масляных ЛКМ,грунтовок,олифы,битума,резинобитумной автомобильной мастики.Смывка автоконсерванта и битумных пятен. Представляет собой высококипящую фракцию бензина, применяется в лакокрасочной промышленности, в производстве олиф и других отраслях промышленности.', '1'), ('2eadcc30-99a8-11db-937f-000e0c431b59', 'Уайт-спирит 1л', '72429777-ff83-11e4-9228-005056be1f7a', '0', '860', '261', 'Растворение и разбавление масляных ЛКМ,грунтовок,олифы,битума,резинобитумной автомобильной мастики.Смывка автоконсерванта и битумных пятен. Представляет собой высококипящую фракцию бензина, применяется в лакокрасочной промышленности, в производстве олиф и других отраслях промышленности.', '1'), ('2eadcc32-99a8-11db-937f-000e0c431b59', 'Уайт-спирит 5л', '72429777-ff83-11e4-9228-005056be1f7a', '0', '518', '114', 'Используется для растворение и разбавление масляных ЛКМ,грунтовок,олифы,битума,резинобитумной автомобильной мастики.Смывка автоконсерванта и битумных пятен. Представляет собой высококипящую фракцию бензина, применяется в лакокрасочной промышленности, в производстве олиф и других отраслях промышленности.', '1'), ('9bd479ef-b369-11e4-a26a-005056be1f7b', 'Грунт БЕТОН-КОНТАКТ 20кг', 'fa733516-ff83-11e4-9228-005056be1f7a', '0', '59', '38', 'Предназначена для обработки гладких минеральных, преимущественно бетонных, вертикальных оснований перед нанесением цементно-песчаных и гипсовых штукатурок и шпаклевок, а так же плиточных клеев, в т.ч. торговой марки Ceresit, при внутренних работах.', '1'), ('763735c0-2a2b-11e2-9366-005056be3bd8', 'Грунт глубокого проникновения Tiefgrund  5л', 'fa733516-ff83-11e4-9228-005056be1f7a', '0', '303', '221', 'Идеально подходит для предварительной обработки очень пористых оснований с целью улучшения адгезии и укрепления поверхности перед укладкой керамической плитки, нанесением штукатурок, шпатлевок, наливных полов и стяжек, а так же перед покраской. Благодаря уникальной рецептуре грунтовка глубокого проникания Альмира обладает исключительной  проникающей способности идеальна для сильно впитывающих оснований.', '1');
